import axios from 'axios';

const API_BASE_URL = "http://127.0.0.1:5000";  // Flask API URL

export const fetchBrentOilData = async () => {
  try {
    const response = await axios.get(`${API_BASE_URL}/brent_prices`);
    return response.data;
  } catch (error) {
    console.error("Error fetching Brent oil data:", error);
    return [];
  }
};
